import React from 'react';

function Blog() {
  return (
    <section id="blog" className="blog-section" data-aos="fade-up">
      <div className="container">
        <h2>Blog</h2>
        <article className="blog-post" data-aos="fade-up" data-aos-delay="100">
          <h3>Welcome to Codeunia's Blog</h3>
          <p>Stay tuned for the latest updates, tutorials, and tech insights.</p>
        </article>
      </div>
    </section>
  );
}

export default Blog;
